calibrationPanel.headCleanCheck=Innan du fortsätter till följande steg, var god och avlägsna det utpressade materialet med hjälp av en pinsett. Klicka på Följande för att fortsätta.
calibrationPanel.heating=AutoMaker värmer nu upp skrivarhuvudet i preparation för kalibrering - var god, vänta...
calibrationPanel.heatingCaps=VÄRMER…
calibrationPanel.initialisingOffset=Innan du startar kalibreringen, var god och avlägsna bädden genom att vrida låshandtaget (markerat) till vänster, avlägsna spetsens torkblad och sedan genom att lyfta arket och dra mot dig. Du behöver en liten bit vanligt papper för kalibreringen, en pinsett är också till nytta för att avlägsna filamentrester.
calibrationPanel.insertPieceOfPaper=Lägg en pappersbit under vänstra munstycket (fin). Klicka sedan Följande, och Roboxen rör sig nedåt för att greppa papret.
