calibrationPanel.justRight=Lagom
calibrationPanel.measuringZOffset=Robox avgör nu det vertikala avståndet mellan munstycken. Var god och vänta…
calibrationPanel.moveThePaperInstruction=Använd upp och ned knapparna för att justera skrivarhuvudets höjd. Sök den lägsta punkten som tillåter papret röra sig fritt under munstyckena utan att röra dem.\n\nNär du funnit denna punkt, klicka på Följande för att slutföra kalibreringen.
calibrationPanel.moveThePaperMessage=Pappersbiten hålls på plats då munstycket pressar det lätt mot bädden.\nDenna del av testet kalibrerar Z avståndet. \nFörsök att ständigt flytta papperet under munstycket, för att bedöma tätheten. Tryck på "För hårt" för att höja munstycket något, pappret rör sig lättare. Fortsätt trycka på "För hårt" tills munstycket vidrör ytan på papperet, men inte pressar den mot basen. När avståndet är lagom, är munstycket tjockleken av pappersbiten ovanför bädden utan att det pressar pappret. Tryck på "Lagom" knappen. Om pappret är för löst, tryck på "För löst" för att sänka munstycket.\n
