calibrationPanel.readyToBeginNozzleOffsetCalibration=Denna rutin kalibrerar munstyckenas lyfthöjd. Då skrivarhuvudet byter mellan munstyckena, lyfts munstycket som inte skriver upp och bort ur vägen. Därmed måste programvaran veta höjdskillnaden mellan munstyckena då de är i utskriftsposition.\n\nOm du har problem med lagrens adhesion eller om det förekommer oenligheter i tjockleken av de några första lagren, var god och utför denna kalibreringsfas.
calibrationPanel.readyToBeginNozzleOpeningCalibration=Denna rutin kalibrerar skrivarhuvudets nålventiler. Programvaran måste veta när plastet börjar flöda för att kunna reglera extruderingen noggrant.\n\Innan du påbörjar kalibreringen, se till att bädden är tom, munstyckena är rena och att SmartReel är laddat i skrivaren. Filamentet måste även flöda fritt ur båda munstyckena -om du tvivlar, utför rengöringssekvensen i Underhåll. En pinsett är bra för att avlägsna filamentrester.
calibrationPanel.recalibrate=Återkalibrera
calibrationPanel.reinsertPEIBed=Återinstallera PEI-bädden
calibrationPanel.replacePEIBed=Placera PEI-bädden tillbaka på plats genom att först skjuta in den i facket, medan du samtidigt säkerställer att ytan är under klämmorna på alla sidor. Skjut in ända bak, och vrid sedan låshandtaget (markerat) till höger för att låsa på plats. Till sist, lägg tillbaka spetsens torkblad och klicka på Följande föratt slutföra kalibreringen.
