calibrationPanel.valvesClosedNoMaterial=Munstyckena är nu värmada, granska att munstyckena är täta när ventilen är fullt stängd.\n\nSer du material komma ut ur munstyckena?
calibrationPanel.valvesClosedNoMaterialPostCalibration=AutoMaker kontrollerar nu kalibreringen. Först, munstyckena stängda - det borde inte komma material ut ur munstyckena - stämmer detta?
calibrationPanel.valvesOpenMaterialExtruding=Nu, munstyckena öppna - material borde komma ut ur båda munstyckena - stämmer detta?
calibrationPanel.valvesOpenMaterialExtruding1=Höger munstycke öppet - material borde nu ses strömma ut
calibrationPanel.xAndYIntroduction=Denna rutin används för att ställa in munstyckenas inriktning i X- och Y-led. Detta hjälper Robox att identifiera båda munstyckenas placering i förhållande till varandra.\n\nOm du har problem med fyllningen och fina, detaljerade delar skrivs ut snett, var god och utför denna kalibreringssekvens.\n\nSäkra att bädden är ren och tom, att du har utfört munstyckenas öppnings- och höjdkalibrering och att SmartReel är laddat i apparaten och färdig för utskrivning. Klicka på Start för att påbörja kalibreringen.
calibrationPanel.xAndYPrintPattern=AutoMaker skriver nu ut ett kalibreringsmönster - var god och vänta...
calibrationPanel.xAndYGetOffsets=Roboxen borde nu ha skrivit ut ett kalibreringsmönster i enlighet med bilden nedan - om det uppstod problem vid utskrift, gå tillbaka till föregående steg och försök sedan igen.\n\n Målet är att finna den bästa möjliga inriktningen mellan munstyckena på X- och Y-axlarna. Ange numret och bokstaven i rutorna nedan som bäst motsvarar paren i linjeför varje riktning:
calibrationPanel.xAndYPrintingCircle=Robox kontrollerar nu inriktningen genom att skriva ut en cirkel i övre vänstra hörnet.
calibrationPanel.xAndYPrintCircleCheck=Finmunstyckets cirkel bör vara exakt i mitten av fyllningsmunstyckets cirkel. Om cirklarna inte är  väl i linje, måste kalibreringen utföras igen. När du är nöjd, klicka på Följande för att fortsätta.
